import React from "react";
import Sidebar from "../Sidebar";

import * as S from "./PageLayout.styles";

const PageLayout = ({ children }) => {
  return (
    <>
      <Sidebar />
      <S.Content>
        <div>{children}</div>
      </S.Content>
    </>
  );
};

export default PageLayout;
